{
  "rules": {
    "forbidden": {
      ".read": false,
      ".write": false
    },
    "__tests": {
      ".read": true,
      ".write": true
    },
    ".read": false,
    ".write": false
  }
}

{
  "firestore": {
    "rules": "firestore.rules"
  },
  "database": {
    "rules": "database.rules.json"
  },
  "storage": {
    "rules": "storage.rules"
  },
  "hosting": {
    "public": "docs/.vitepress/dist"
  },
  "extensions": {},
  "emulators": {
    "auth": {
      "port": 9099
    },
    "firestore": {
      "port": 8080
    },
    "database": {
      "port": 8081
    },
    "storage": {
      "port": 9199
    },
    "hosting": {
      "port": 5050
    },
    "ui": {
      "enabled": true
    },
    "singleProjectMode": true
  },
  "functions": [
    {
      "source": "functions",
      "codebase": "default",
      "ignore": [
        "node_modules",
        ".git",
        "firebase-debug.log",
        "firebase-debug.*.log",
        "*.local"
      ]
    }
  ]
}

rules_version = '2';
service cloud.firestore {
  match /databases/{database}/documents {
    match /__tests/{document=**} {
      allow read, write;
    }

    match /todos/{todoId} {
      allow read, write;
    }
    match /tweets/{todoId} {
      allow read, write;
    }
    match /users/{todoId} {
      allow read: if request.auth.uid != null;
      allow write: if false;
    }
    match /configs/jORwjIykFo2NmkdzTkhU {
      allow read, write;
    }

    match /playground/pinia-counter {
      allow read, write;
    }

    match /{document=**} {
      allow read, write: if false;
    }
  }
}

{
  "name": "vuefire",
  "version": "3.2.1",
  "description": "Official Firebase bindings for Vue.js",
  "packageManager": "pnpm@9.5.0",
  "engines": {
    "node": ">=18"
  },
  "volta": {
    "node": "20.11.1"
  },
  "type": "module",
  "exports": {
    ".": {
      "types": {
        "import": "./dist/index.d.mts",
        "require": "./dist/index.d.cts"
      },
      "import": "./dist/index.mjs",
      "require": "./dist/index.cjs"
    },
    "./server": {
      "types": {
        "import": "./dist/server/index.d.mts",
        "require": "./dist/server/index.d.cts"
      },
      "import": "./dist/server/index.mjs",
      "require": "./dist/server/index.cjs"
    }
  },
  "main": "./dist/index.cjs",
  "module": "./dist/index.mjs",
  "types": "./dist/index.d.mts",
  "sideEffects": false,
  "files": [
    "dist",
    "server.d.ts",
    "LICENSE",
    "README.md"
  ],
  "author": {
    "name": "Eduardo San Martin Morote",
    "email": "posva13@gmail.com"
  },
  "funding": "https://github.com/sponsors/posva",
  "scripts": {
    "docs": "vitepress dev docs --port 3000",
    "docs:build": "pnpm run docs:api:build && vitepress build docs",
    "docs:api:build": "node ./scripts/run-typedoc.mjs",
    "build": "unbuild",
    "release": "node scripts/release.mjs",
    "changelog": "conventional-changelog -p angular -i CHANGELOG.md -s --commit-path src -l vuefire -r 1",
    "play": "pnpm run -C playground dev",
    "lint": "prettier -c --parser typescript \"{src,__tests__,e2e}/**/*.[jt]s?(x)\"",
    "lint:fix": "pnpm run lint --write",
    "test:types": "tsc --build tsconfig.json",
    "test:unit": "vitest --coverage",
    "firebase:emulators": "firebase emulators:start",
    "test:dev": "vitest --ui",
    "test": "pnpm run lint && pnpm run test:types && pnpm run build && pnpm run -C packages/nuxt build && pnpm run test:unit run",
    "prepare": "simple-git-hooks"
  },
  "keywords": [
    "vue",
    "firebase",
    "vuefire",
    "vuexfire",
    "vuex",
    "composition",
    "api"
  ],
  "license": "MIT",
  "dependencies": {
    "vue-demi": "latest"
  },
  "peerDependencies": {
    "consola": "^3.2.3",
    "firebase": "^9.0.0 || ^10.0.0 || ^11.0.0",
    "vue": "^2.7.0 || ^3.2.0"
  },
  "peerDependenciesMeta": {
    "firebase": {
      "optional": true
    },
    "@vue/composition-api": {
      "optional": true
    },
    "consola": {
      "optional": true
    }
  },
  "devDependencies": {
    "@posva/prompts": "^2.4.4",
    "@vitest/coverage-v8": "^2.1.3",
    "@vitest/ui": "^2.1.3",
    "@vue/test-utils": "^2.4.6",
    "chalk": "^5.3.0",
    "consola": "^3.2.3",
    "conventional-changelog-cli": "~4.1.0",
    "enquirer": "^2.4.1",
    "execa": "^9.5.2",
    "firebase": "^11.1.0",
    "firebase-admin": "^13.0.1",
    "firebase-tools": "^13.29.1",
    "focus-visible": "^5.2.1",
    "globby": "^14.0.0",
    "happy-dom": "^15.7.4",
    "lint-staged": "^15.2.10",
    "minimist": "^1.2.8",
    "p-series": "^3.0.0",
    "prettier": "^3.3.3",
    "semver": "^7.6.3",
    "simple-git-hooks": "^2.9.0",
    "typedoc": "^0.25.8",
    "typedoc-plugin-markdown": "^3.17.1",
    "typescript": "~5.5.4",
    "unbuild": "^2.0.0",
    "vitepress": "1.4.1",
    "vitest": "^2.1.3",
    "vue": "^3.5.12"
  },
  "simple-git-hooks": {
    "pre-commit": "pnpm lint-staged",
    "commit-msg": "node scripts/verifyCommit.mjs"
  },
  "lint-staged": {
    "*.{js,mjs,json,cjs}": [
      "prettier --write"
    ],
    "*.ts?(x)": [
      "prettier --parser=typescript --write"
    ]
  },
  "repository": {
    "type": "git",
    "url": "git+https://github.com/vuejs/vuefire.git"
  },
  "bugs": {
    "url": "https://github.com/vuejs/vuefire/issues"
  },
  "homepage": "https://github.com/vuejs/vuefire#readme"
}

rules_version = '2';
service firebase.storage {
  match /b/{bucket}/o {
    match /tests/{allPaths=**} {
      allow read, write: if true;
    }
    match /{allPaths=**} {
      allow read, write: if false;
    }
  }
}

import { defineConfig } from 'vitest/config'

export default defineConfig({
  optimizeDeps: {
    exclude: ['vue-demi'],
  },
  test: {
    environment: 'happy-dom',
    include: ['tests/**/*.spec.ts'],
    coverage: {
      include: ['src/**/*.ts'],
      reporter: ['text', 'json', 'html'],
      exclude: ['src/**/*.spec.ts', 'src/index.ts'],
    },
  },
})

import { defineWorkspace } from 'vitest/config'

export default defineWorkspace([
  // vuefire
  './',
  // nuxt-vuefire
  './packages/nuxt',
])
